import React from "react";
import { Switch, Route, Redirect } from "react-router-dom";


// components
import Sidebar from "../components/Sidebar/sidebar";
import HeaderStats from "../components/Headerstats/Headerstats"
import HeaderstatsLeaves from "../components/"
import AdminNavbar from "../components/Navbar/AdminNavbar"

// views
import Dashboard from "../views/Admin/Dashboard";
import EmployeesLeaves from "../views/Admin/leave";
import Tables from "../views/Admin/table"


export default function Admin() {
    return(
        <>
            <Sidebar />
            <div className="relative md:ml-64 bg-gray-200">
                <AdminNavbar />
                <HeaderStats />
                <div className="px-4 md:px-10 mx-auto w-full -m-24">
                        <Switch>
                            <Route path="/admin/dashboard" exact component={Dashboard} />
                            <Route path="/admin/EmployeesLeaves" exact component={EmployeesLeaves} />
                            <Route path="/admin/Tables" exact component={Tables} />
                        </Switch>
                </div>
            </div>
        </>
    )
}
